import React from 'react';
import {aidos} from '../overview/aidos.png'
import 'bootstrap/dist/css/bootstrap.css';
import './index.css';
import {Link} from 'react-router-dom';



function DeasThreeComponent() {
    return (
        <div>
             <Link to="/hardwfb/one">
                <button className='b1'>
                    Robot Inspection
                </button>
            </Link>
            <Link to="/hardwfb/two">
                <button className='b2'>
                    Field Inspection
                </button>
            </Link>
        </div>
    );
}

export default DeasThreeComponent;
